import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import {
    RecoilRoot,
    atom,
    selector,
    useRecoilState,
    useRecoilValue,
} from 'recoil';

ReactDOM.render(
    <RecoilRoot>
        <React.StrictMode>
            <App/>
        </React.StrictMode>,
    </RecoilRoot>,
document.getElementById('root')
)
;

// If you want to start measuring performance in your app, pass a function
